import React, {Component} from "react";
import { useNavigate } from "react-router-dom";
export default class Home extends Component{
    check = () =>{
        if(!localStorage.getItem("session")){
            console.log("esta en falsa");
        }
    }
    render(){
        this.check()
        return(
            <div>
                <h1>Home</h1>
            </div>
        )
    }
}
